#include <stdio.h>
#define MAXLINE 131072        /* this constrains line length */
int main() {
  char in[MAXLINE];
  char out[MAXLINE];
  int return_value;

  while(fgets(in,MAXLINE,stdin) != NULL) {
    in[strlen(in)-1] = '\0';                       /* chop */
    return_value = t_accepts(in,out,MAXLINE);
    switch(return_value) {
    case 0:
      fprintf(stderr,"no\n");
      break;
    case 1:
      printf("%s\n",out);
      break;
    case 2:
      fprintf(stderr,"error: output line too long\n");
      break;
    }
  }                                         /* end-of-file */
  return 0;
}

